import React from "react";
import { Card, Image } from "react-bootstrap";
import UsersConteiner from "../wiki/UsersConteiner";
import ListGroup from 'react-bootstrap/ListGroup';
import defaut from '../img/defaut_awatar.jpg'

const Users = () => {
    const users = new UsersConteiner();
    return(
        <Card style={{borderRadius: 20, margin: '0px 80px 0px 80px'}}>
            <ListGroup>
                {users.users.map(user =>
                    <Card style={{margin: 20, color: "#EDEEF0"}}>
                        <Image
                            src = {defaut}
                            width={90}
                            roundedCircle
                            style={{margin: 10}}
                        ></Image>
                    </Card>
                )}   
            </ListGroup>
        </Card>
    );
};

export default Users;
